import React from 'react';
import '../Components/main.css'
import '../Components/office-plan.css'
import '../Components/bootstrap-theme.css'
import '../Components/about.css'
import avatar from '../images/avatar.jpg'
import {Button} from "react-bootstrap";

const About = () => {
    const pic = null || avatar
    const urlParams = new URLSearchParams(window.location.search)
    const id = urlParams.get("id")
    const name = null || 'John Smith'
    const technology = null || 'unknown'
    const position = null || 'unknown'
    const workspace = null || 'unknown'
    const employed_since = null || 'unknown'
    return (
        <div className="aboutContainer">
            <div className={"leftSide"}>
                <h1>{name}</h1>
                <br/>
                <img src={pic} width="300px"/>
            </div>
            <div className={"middleSide"}>
                <h2>Technology: <span>{technology}</span></h2>
            </div>
            <div className={"rightSide"}><Button>Edit</Button></div>
        </div>
    );
};

export default About;
